  MainLevel2.prototype.map = function(number, istart, istop, ostart, ostop) {
    return ostart + (ostop - ostart) * ((number - istart) / (istop - istart));
  };
  
  MainLevel2.prototype.avoidCollision = function( contact )
  {
  var bodies = [ contact.GetFixtureA().GetBody(), contact.GetFixtureB().GetBody() ];
    var shipIndex = ( bodies[0].tag === "Ship" ) ? 0 : -1;
    shipIndex = ( bodies[1].tag === "Ship" ) ? 1 : shipIndex;
    
    if ( shipIndex === -1 )
      return;
    
    if ( bodies[0].tag === bodies[1].tag )
      return;

  //decide if collision disabled
  for ( var i = 0; i < bodies.length; i++ )
    if ( bodies[i].tag === "dust" || bodies[i].tag === "trigger" )
      contact.SetEnabled(false);
  
    var dust = false;
    if ( bodies[0].tag === "dust") {
      dust = bodies[0];
    } else if ( bodies[1].tag === "dust") {
      dust = bodies[1];
    }

    if (dust) {
      var p = dust.GetPosition();
      var b = bodies[shipIndex];
      b.parent.particles[dust.id] = b.parent.particles[dust.id] || [];
      if (b.parent.particles[dust.id].length < 2) {
        b.parent.particles[dust.id].push(new ParticleEmitter((p.x * 30), (p.y * 30)));
      }
    }
  
  //get trigger 
  var triggerBody = ( bodies[0].tag === "trigger" ) ? bodies[0] : null;
  triggerBody = ( triggerBody === null ) ? bodies[1] : triggerBody;

  if ( triggerBody.tag === "trigger" )
    triggerBody.trigger();
  }
  
  
